__NUXT_JSONP__("/", (function(a,b,c,d,e,f){return {data:[{}],fetch:{"0":{about:{slug:"about",toc:[],body:{type:"root",children:[{type:b,tag:c,props:{},children:[{type:a,value:"Raised in the rust belt of Canada, Nathalie Bibeau is an award-winning filmmaker known for her artful approach to provocative stories. Her first feature film, "},{type:b,tag:d,props:{},children:[{type:a,value:" The Walrus and the Whistleblower"}]},{type:a,value:", won the top Audience Award at the 2020 Hot Docs International Film Festival. The film went on to play in the Winnerâ€™s Circle at DOC NYC and traveled to over twenty other festivals worldwide, winning the Best Documentary Feature Award at three of them."}]},{type:a,value:e},{type:b,tag:c,props:{},children:[{type:a,value:"In 2022, she released the four-part series, "},{type:b,tag:d,props:{},children:[{type:a,value:"The Unsolved Murder of Beverly Lynn Smith"}]},{type:a,value:", series directing and showrunning the first Amazon Original documentary series in Canada."}]},{type:a,value:e},{type:b,tag:c,props:{},children:[{type:a,value:"In previous lives, Nathalie has written for various media outlets, volunteered for War Child in Ethiopia and worked for the Department of Foreign Affairs in Lithuania. She holds a B.A. in History from McGill University and an M.A. in Russian History from the University of Toronto. She is a mother of two and is fluent in French, English and Swedish."}]}]},dir:"\u002F",path:"\u002Fabout",extension:".md",createdAt:f,updatedAt:f}}},mutations:void 0}}("text","element","p","i","\n","2023-06-26T19:04:35.653Z")));